    description:
      "&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Wynn's Cooling System Flush концентрований продукт для очищення системи охолодження автомобілів.&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;li&gt;Потужний безкислотний очищувач радіатора.&lt;/li&gt;&lt;li&gt;Подвійна дія: Очищає від накипу. Знищує іржу, відкладення бруду і залишки масла.&lt;/li&gt;&lt;li&gt;Відмінна ефективність у всіх типах охолоджуючої рідини, в тому числі ОАТ антифризах (антифризи засновані на органічних карбонових кислотах).&lt;/li&gt;&lt;li&gt;Утримує бруд в підвішеному стані під час очищення.&lt;/li&gt;&lt;li&gt;Безпечний для гумових шлангів, ущільнень і всіх металевих частин системи охолодження.&lt;/li&gt;&lt;li&gt;Надзвичайно ефективний у всіх замкнутих системах охолодження.&lt;/li&gt;&lt;li&gt;Відновлює оптимальний режим роботи управління в системі охолодження.&lt;/li&gt;&lt;/ul&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Застосування&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для &quot;водяних&quot; систем охолодження всіх бензинових і дизельних двигунів.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Рекомендується використовувати при заміні ОЖ (слідувати рекомендаціям виробника).&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Особливо ефективний при очищенні старих систем охолодження.&lt;/p&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Інструкції&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Добре струсіть банку з продуктом. Залийте його в радіатор або в розширювальний бачок, в тому випадку якщо на радіаторі немає заливної горловини.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для більш високої продуктивності, спочатку замініть стару охолоджуючу рідину водою, а потім додайте в систему охолодження Wynn's Cooling System Flush.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Прогрійте двигун з включеним нагрівачем салону на максимальному обігріві.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Дайте попрацювати двигуну на холостих обертах протягом 10 хвилин. Весь цей час обігрівач салону повинен бути включений на максимальному обігріві.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Заглушіть двигун, дайте рідині охолонути. Злийте стару охолоджуючу рідину.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Промийте систему водою, до повного вимивання залишків. Закрийте зливні отвори і залийте в систему нову охолоджуючу рідину.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Однієї банки продукту 325 мл достатньо для обробки системи об'ємом до 12 літрів.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для запобігання течі охолоджуючої рідини використовуйте Wynn's Cooling System Stop Leak.&lt;/p&gt;",
