    description:
      "&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Wynn's Air Intake &amp;amp; Carburettor очищувач, призначений для усунення забруднень і відкладень в повітряних каналах, жиклерах і регулювальних гвинтах карбюратора, а також на всіх видимих компонентах карбюратора.&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;li&gt;Активні сольвенти розчиняють і видаляють бруд дуже швидко.&lt;/li&gt;&lt;li&gt;Потужне розпорошення покращує очищаючу дію.&lt;/li&gt;&lt;li&gt;Очищає карбюратор і повітроприймальні системи без розбирання.&lt;/li&gt;&lt;li&gt;Розчиняє смолу, лак і відкладення.&lt;/li&gt;&lt;/ul&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Застосування&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;У системі впуску інжекторних і карбюраторних бензинових двигунів.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;На видимих компонентах карбюратора (вентиляційні канали, регулювальні гвинти, витратомір, зовнішні частини).&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;На дросельній заслінці і дроселі.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;На клапанах вентиляції картера.&lt;/p&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Інструкції&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для карбюратора&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для очищення видимих ​​компонентів: Зніміть повітряний фільтр. Запустіть двигун і дайте йому прогрітися. Встановіть дросель у відкрите положення. При прогрітому двигуні, розпорошіть продукт у впускний повітряний колектор на брудні компоненти. Розпилюйте з інтервалами. При необхідності збільште обороти двигуна щоб уникнути зупинки двигуна через збагачення суміші. Продовжуйте, поки всі компоненти не очистяться.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Впускний колектор / дросельна заслінка&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Зніміть повітряний фільтр, прогрійте двигун, встановіть дросель у відкрите положення. При прогрітому двигуні, розпорошіть продукт у впускний повітряний колектор з інтервалами. Розпорошіть продукт на дросельну заслінку. При необхідності збільште обороти двигуна щоб уникнути зупинки двигуна. У разі якщо система уприскування обладнана клапаном витрати повітря, при необхідності відкрити клапан вручну.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Повітряна заслінка з автоматичним управлінням&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Зніміть очисник повітря. При непрацюючому двигуні, розпорошіть продукт з двох сторін дросельної заслінки за допомогою ручного відкриття і закриття.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;П.В.К. (Примусова Вентиляція Картера)&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Вимкніть П.В.К. з боку картера. Вставте трубку подовжувач в відкриту частину клапана і розпилюйте продукт під час руху клапана вперед і назад. Запустіть двигун, розпорошіть продукт в клапан кілька разів, для повного його промивання.&lt;/p&gt;",
