    description:
      "&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Wynn's DIESEL EXTREME CLEANER (Diesel Clean 3) добавка в дизельне паливо, яка забезпечує потужне очищення паливної системи дизельних двигунів за одну заливку.&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;li&gt;Повне очищення паливної системи за одну заливку&lt;/li&gt;&lt;li&gt;Миттєво очищає і захищає інжектори, відновлює і підтримує оптимальний режим упорскування палива.&lt;/li&gt;&lt;li&gt;Забезпечує чистоту клапанів системи EGR і турбокомпресора.&lt;/li&gt;&lt;li&gt;Відновлює параметри згоряння палива і оптимальні характеристики роботи двигуна.&lt;/li&gt;&lt;li&gt;Ефективно змащує форсунки і деталі насоса.&lt;/li&gt;&lt;li&gt;Компенсує недолік змащення в низькосірчистому паливі і захищає схильні до стресових впливів поверхні в паливних насосах високого тиску і форсунках.&lt;/li&gt;&lt;li&gt;Перешкоджає оксидації (старіння) дизельного палива під впливом високих температур.&lt;/li&gt;&lt;li&gt;Усуває проблеми холодного запуску&lt;/li&gt;&lt;li&gt;Сприяє сепарації води в паливному фільтрі і захисту паливної системи&lt;/li&gt;&lt;li&gt;Перешкоджає засміченню паливного фільтра і паливної системи живлення в цілому.&lt;/li&gt;&lt;li&gt;Зменшує вихлопи. Не завдає шкоди каталітичному нейтралізатору.&lt;/li&gt;&lt;/ul&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Застосування&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для всіх типів дизельних двигунів.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для дизпалива і біодизпалива до B30.&lt;/p&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Інструкції&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для досягнення найкращих результатів використовуйте одну бутель не менше ніж з половиною паливного бака (± 20 літрів диз. Палива).&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Повторювати кожні 10.000 км.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;",
