    description:
      "&lt;p&gt;Wynn's Super Charge® - присадка подвійної дії, розроблена для поліпшення в'язкістних характеристик моторних олив при високих температурах і для запобігання течі гумових / неопренових прокладок.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Знижує надмірну витрата масла через поршневі кільця і ​​направляючі клапанів.&lt;/p&gt;&lt;p&gt;Підвищує індекс в'язкості моторних масел тільки при робочій температурі двигуна.&lt;/p&gt;&lt;p&gt;Омолоджує ущільнювальні сальники і гумові / неопренові кільця ущільнювачів.&lt;/p&gt;&lt;p&gt;Відновлює компресію і тиск масла.&lt;/p&gt;&lt;p&gt;Знижує кількість димності вихлопних газів при підвищеній витраті масла.&lt;/p&gt;&lt;p&gt;Утворює міцну масляну плівку при високих температурах і навантаженнях.&lt;/p&gt;&lt;p&gt;Знижує шуми в двигуні за рахунок стійкої масляної плівки.&lt;/p&gt;&lt;p&gt;Зупиняє і запобігає витоку масла без розбирання двигуна.&lt;/p&gt;&lt;p&gt;Сумісна з усіма мінеральними, синтетичними, напівсинтетичними, одно- і всесезоннимі.&lt;/p&gt;&lt;p&gt;Не руйнує каталізатори.&lt;/p&gt;&lt;p&gt;Застосування&lt;/p&gt;&lt;p&gt;Ефективна при великих навантаженнях і високих температурах.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Особливо ефективна в старих двигунах.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Ефективна при надмірній течі через маслоз'ємні ковпачки клапанів.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Рекомендується для всіх бензинових і дизельних двигунів при підвищеній витраті масла і низь&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Інструкції&lt;/p&gt;&lt;p&gt;Розігрійте двигун до робочої температури і заглушіть його.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Додати вміст банки до моторної оливи. 1 банка (325 мл) додається до 3-6 літрів моторної оливи.&lt;/p&gt;",
