      "&lt;p&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;Wynn's Super Charge - присадка в моторну оливу, призначена для поліпшення в'язкісних характеристик моторних мастил при високих температурах.&lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;Характеристики:&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;&lt;h3&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;&lt;p style=&quot;line-height: 1.5;&quot;&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;Покращує в'язкісні характеристики моторних олив, при робочій температурі двигуна.&lt;br&gt;Зміцнює масляну плівку при високих температурах, при великих навантаженнях.&lt;br&gt;Відновлює компресію і тиск мастила.&lt;br&gt;Зменшує витрати масла.&lt;br&gt;Запобігає контакту металу з металом при високих навантаженнях.&lt;br&gt;Знижує шуми в двигуні.&lt;br&gt;Захищає від корозії, окислення і зносу.&lt;br&gt;Сумісно з усіма оливами.&lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;Застосування:&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;&lt;p style=&quot;line-height: 1.5;&quot;&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;Особливо ефективна при роботі під великими навантаженнями і при високих температурах.&lt;br&gt;Рекомендується для всіх бензинових і дизельних двигунів автомобілів і стаціонарного обладнання з великою витратою палива, низьким тиском масла і низькою компресією.&lt;br&gt;Особливо ефективна в старих двигунах.&lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;Вказівки:&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;&lt;h3&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;&lt;p style=&quot;line-height: 1.5;&quot;&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;Додати до кількості 6-10% від обсягу моторного масла.&lt;br&gt;При жорстких умовах експлуатації і надмірній витраті мастила слід збільшити концентрацію до max 15%.&lt;br&gt;Додайте Wynn's Super Charge в моторну оливу через маслозаливну горловину.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;",
