    name: "WYNN'S W29601 CLEAN AIR Нейтралізатор неприємних запахів (аерозоль) 100мл",
    description:
      "&lt;p&gt;Wynn's Clean-Air видаляє і нейтралізує неприємні запахи в автомобілі.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Нейтралізує запахи за допомогою молекулярної хімічної реакції.&lt;/li&gt;&lt;li&gt;Миттєво видаляє неприємні запахи.&lt;/li&gt;&lt;li&gt;Ефективний в широкому діапазоні неприємних запахів:&lt;/li&gt;&lt;li&gt;Сигаретний дим, запах тварин, запах поту і т.п.&lt;/li&gt;&lt;li&gt;Усуває запах їжі.&lt;/li&gt;&lt;li&gt;Усуває запах блювоти, цвілі й вогкості.&lt;/li&gt;&lt;li&gt;Усуває неприємні запахи оббивки сидінь, кузова і килимків&lt;/li&gt;&lt;li&gt;Хімічна нейтралізація молекул, які викликають запах, замість маскування неприємних запахів.&lt;/li&gt;&lt;li&gt;Довгостроковий ефект.&lt;/li&gt;&lt;li&gt;Має делікатний свіжий запах м'ятної парфумерії, який повільно зникає після застосування.&lt;/li&gt;&lt;li&gt;Не залишає плям.&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;h4&gt;&lt;b&gt;Застосування&lt;/b&gt;&lt;/h4&gt;&lt;p&gt;Для використання в автомобілях і автобусах.&lt;/p&gt;&lt;hr&gt;&lt;h4&gt;&lt;b&gt;Інструкції&lt;/b&gt;&lt;/h4&gt;&lt;p&gt;Якщо можливо, видаліть джерело неприємних запахів (очистіть попільнички, видаліть бруд з тканин)&lt;/p&gt;&lt;p&gt;Переконайтеся, що температура аерозолю в районі 20 ° C. Ідеально застосування при температурі від 5 до 30 ° C.&lt;/p&gt;&lt;p&gt;Поставте спрей в центрально-нижню точку салону автомобіля або кабіни вантажівки&lt;/p&gt;&lt;p&gt;Натисніть на розпилювач до клацання блокіратора&lt;/p&gt;&lt;p&gt;Розпилення активовано, і автоматично розпорошіть весь продукт всередині салону автомобіля.&lt;/p&gt;&lt;p&gt;Закрийте двері автомобіля зовні, і почекайте поки балончик не спустошиться (приблизно 2 хвилини)&lt;/p&gt;&lt;p&gt;Приберіть порожній балончик, відкрийте двері автомобіля для провітрювання на 5 хвилин.&lt;/p&gt;&lt;p&gt;Повторіть обробку в разі, якщо неприємний запах зберігся після першої обробки.&lt;/p&gt;&lt;p&gt;Якщо продукт залишився на поверхні (наприклад стелі), просто протріть її добре  тканиною.&lt;/p&gt;&lt;p&gt;Wynn's Clean-Air не залишає плям на тканині, металі, пластику, гумі, деревині.&lt;/p&gt;&lt;p&gt;Не розпилюйте безпосередньо на продукти харчування, напої, тварин і людей.&lt;/p&gt;",
