      "&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Wynn's Diesel System Purge створена для усунення бруду і відкладень в системах упорскування дизельного палива. Вона використовується з обладнанням Wynn's RCP, FuelSystemServe або FuelServe.&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;li&gt;Очищає всю паливну систему дизельного двигуна без демонтажу компонентів.&lt;/li&gt;&lt;li&gt;Відновлює роботу форсунок і покращує процес згорання палива.&lt;/li&gt;&lt;li&gt;Знижує токсичність вихлопних газів і сажі.&lt;/li&gt;&lt;li&gt;Готовий до використання.&lt;/li&gt;&lt;li&gt;Зменшує «дизельний стук».&lt;/li&gt;&lt;li&gt;Безпечний для каталітичних нейтралізаторів і саж фільтрів (DPF).&lt;/li&gt;&lt;/ul&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Застосування&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Може використовуватися на всіх дизельних автомобілях, вантажівках, морських і стаціонарних двигунах, з або без турбокомпресора.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для всіх дизельних двигунів включаючи двигуни з комммон рейл і HDI, JTD, CDTi, CDI, ....&lt;/p&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Інструкції&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Використовувати тільки з обладнанням компанії Wynn's - RCP, FuelSystemServe або FuelServe. Час промивки: 20 хв. (див. Інструкцію по експлуатації Wynn's). Не можна заливати В ПАЛИВНИЙ БАК.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Легкові автомобілі (Двигун до 3 л): 1 літр для 1 обробки&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Рекомендується робити промивання кожні 20000 км (від 400 до 600 годин роботи) або при наявності проблем з забрудненням інжекторів, чорного диму, при мінливому холостому ході, поганій приємистості і т.д.&lt;/p&gt;",
    tag: "WYNN'S W89195, промивка дизеля, Diesel System Purge",
