    name: "W68432 Прилад для очистки паливної системи FUELSYSTEMSERVE",
    description:
      "&lt;p&gt;&lt;span class=&quot;tlid-translation translation&quot; lang=&quot;uk&quot;&gt;Wynn's FuelsystemServe установка дозволяє проводити очистку инжекторной системи бензинових і дизельних двигунів без попереднього розбирання. Харчування здійснюється від акумулятора автомобіля (напруга від 11 до 16 В).&lt;br&gt;&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Проводить очищення без попереднього розбирання паливної системи.&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Простота підключення і зручність в зверненні.&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Подачу рідини для очищення можна регулювати залежно від забрудненості або об'єму двигуна.&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; Живлення здійснюється від акумулятора автомобіля (12 В).&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Коли обробка завершена, пристрій автоматично зупиняється і включається світлова індикація.&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Пристрій може бути вимкнено в будь-який момент обробки. Повністю закритий бачок для розчин для чищення, дозволяє уникнути витоку її парів.&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Захисна кришка на баку з захистом від зниженого і надлишкового тиску.&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Установка включає в себе універсальний комплект шлангів і адаптерів з швидкими роз'ємами, придатний для підключення практично до всіх систем уприскування.&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Для замовлення також доступні додаткові адаптери, наприклад на автомобілі вироблені в С.Ш.А.&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Установка знаходиться в повністю пластиковому ящику і обладнана ручкою для легкого перенесення.&lt;br&gt;&lt;br&gt;&amp;nbsp;Може бути приєднаний до всіх паливних систем, як бензинових (карбюратор, K-, KE-, L-, LE-, LH-, Mono-jetronic, Motronic, Renix, прямий впорскування, і т.д.) так і дизельних двигунів ( форкамера і безпосереднє уприскування, коммон Рейлі, насос-форсунки). Для легкових автомобілів, вантажівок, автобусів, водного транспорту і стаціонарного обладнання.&lt;br&gt;&lt;br&gt;&amp;nbsp;Тільки для використання разом з рідинами Wynn's Injection System Purge (W76695) і Wynn's Diesel System Purge (W89195).&lt;/span&gt;&lt;/p&gt;",
    tag: "W68432 Прилад для очистки паливної системи FUELSYSTEMSERVE",
    meta_title: "W68432 Прилад для очистки паливної системи FUELSYSTEMSERVE",
