    description:
      "&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Wynn's Super Concentrated -70С Screen-Wash 21+ (Рідина для очищення вітрового скла в зимовий час.)&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;li&gt;Захищає систему омивання лобового скла від замерзання до -70 ° C.&lt;/li&gt;&lt;li&gt;Безпечний для забарвлених і гумових поверхонь.&lt;/li&gt;&lt;li&gt;Не залишає білих плям на кузові автомобіля.&lt;/li&gt;&lt;li&gt;Не містить метанолу.&lt;/li&gt;&lt;li&gt;Отдушка: лимон&lt;/li&gt;&lt;li&gt;Колір синій&lt;/li&gt;&lt;/ul&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Інструкції&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Залийте засіб в концентрованому або розведеному вигляді в бачок омивача лобового скла.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для отримання рідини омивача з температурою замерзання:&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;до-8С необхідно розвести концентрат з водою в співвідношенні 3 до 1 (3 літри води на 1 літр концентрату);&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;до -23С необхідно розвести концентрат з водою у співвідношенні 1 до 1 (1 літр води на 1 літр концентрату);&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;до-34С необхідно розвести концентрат з водою у співвідношенні 1 до 2 (1 літр води на 2 літри концентрату);&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;до -70С - не розводити (Концентрат в чистому вигляді).&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;br&gt;&lt;/div&gt;",
