    description:
      "&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Wynn's Dry Fuel видаляє конденсат в паливній системі (застосовується для бензинових і дизельних двигунів).&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;li&gt;Абсорбує воду в паливній системі.&lt;/li&gt;&lt;li&gt;Захищає від утворення корозії.&lt;/li&gt;&lt;li&gt;Перешкоджає утворенню льоду в паливній системі.&lt;/li&gt;&lt;li&gt;Забезпечує м'яке очищення інжекторів.&lt;/li&gt;&lt;li&gt;Покращує холодний запуск двигуна.&lt;/li&gt;&lt;li&gt;Wynn's Dry Fuel придатна для дизельних і бензинових двигунів, етилованого і неетильованого бензину, не містить компонентів, що руйнують каталізатори.&lt;/li&gt;&lt;li&gt;Може бути використана в 100% біопаливах, чистому (B100) або змішаних видах (B02, B05, B30, ...).&lt;/li&gt;&lt;/ul&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Застосування&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для всіх бензинових і дизельних двигунів з турбокомпресором або без нього.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Для автомобілів, вантажівок, стаціонарного обладнання та водного транспорту, ємностей для зберігання.&lt;/p&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Інструкції&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Стандартне дозування: додайте 1 бутель з 325 мл. продукту в паливний бак з періодичністю кожні 10.000 км.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;При вологому кліматі або в разі великих коливань температури: кожні 5.000 км.&lt;/p&gt;",
