    name: "WYNN'S W77101 Комплексна добавка в моторну оливу 500мл",
    description:
      "&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Wynn's High Performance Engine Treatment - хімічна присадка повністю розчинна в оливі, яка має подвійну дію:&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;1) Збільшує компресію.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;2) Зменшує знос.&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;li&gt;Допомагає продовжити термін служби двигуна за рахунок зниження окислення масла, тертя і зносу.&lt;/li&gt;&lt;li&gt;Підвищує компресію і покращує індекс в'язкості оливи, запобігає передчасному загустінню залитої оливи.&lt;/li&gt;&lt;li&gt;Запобігає скупченню шламу і бруду; підтримує чистоту системи змащення.&lt;/li&gt;&lt;li&gt;Знижує споживання оливи і викиди.&lt;/li&gt;&lt;li&gt;Не містить твердих частинок.&lt;/li&gt;&lt;li&gt;Сумісна з усіма видами моторних олив.&lt;/li&gt;&lt;li&gt;Не руйнує каталізатори.&lt;/li&gt;&lt;/ul&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Застосування&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Рекомендується для всіх бензинових і дизельних автомобілів, як нових, так і щодо старих.&lt;/p&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Інструкції&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Додати в моторну оливу, переважно під час або відразу після заміни масла, не перевищуючи при цьому максимальний рівень.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Однією бутлі в 500 мл достатньо для обробки 4-6 л оливи.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Додавати в оливу щорічно або через кожні 15000 км.&lt;/p&gt;",
    tag: "WYNN'S W77101 Комплексна добавка в моторну оливу 500мл",
