      "&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Wynn's Airco-Clean® - ультразвуковий дезінфектор, що видаляє неприємні запахи з системи кондиціонування. Використовується разом з обладнанням Wynn's Aircomatic®. Нейтралізує бактеріальні зараження, грибки і бактерії в системі кондиціонування повітря і вимиває їх з випарника.&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;li&gt;Видаляє жирові відкладення, пил та інший бруд з випарника кондиціонера.&lt;/li&gt;&lt;li&gt;Усуває неприємні запахи і запах сигаретного диму в системах кондиціонування повітря і запобігає їх повторній появі протягом тривалого періоду часу.&lt;/li&gt;&lt;li&gt;Нейтралізує бактеріальні зараження, грибки і бактерії в системі кондиціонування повітря і вимиває їх з випарника.&lt;/li&gt;&lt;li&gt;Запобігає алергічні реакції (чхання, кашель, подразнення очей, біль в горлі).&lt;/li&gt;&lt;li&gt;Завдяки гарному розпорошенню, з використанням установки Wynn's Aircomatic®, випарник ретельно очищається.&lt;/li&gt;&lt;li&gt;Залишає приємний освіжаючий запах в машині після обробки.&lt;/li&gt;&lt;li&gt;Використовувані біорозкладні поверхнево-активні речовини відповідно до методу випробувань OECD 301 AF.&lt;/li&gt;&lt;li&gt;Ефективність продукту проти бактерій і грибків була протестована відповідно до стандартів: NEN-EN1040; NEN-EN 1275; NEN-EN 1276; NEN-EN 1650; NEN-EN 13697 (чиста поверхня і забруднена поверхня), для таких мікроорганізмів: синьогнійної палички (1); Кишкова паличка (2); Золотистий стафілокок (3); Ентерококи (4); Кандида біла (5); Чорна цвіль (6).&lt;/li&gt;&lt;li&gt;Ефективність препарату була продемонстрована після обробки більш ніж 15 хвилин за винятком тестів NEN-EN 13697 (забруднені поверхні), бактерицидний ефект на (3) і (4) був зареєстрований після 60 хвилин часу обробки.&lt;/li&gt;&lt;/ul&gt;&lt;hr style=&quot;margin-top: 20px; margin-bottom: 20px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(34, 34, 34); margin-top: 10px; margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Застосування&lt;/span&gt;&lt;/h4&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Всі системи повітряного кондиціонування автомобілів, вантажівок і автобусів.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;Обробку рекомендовано проводити щорічно.&lt;/p&gt;&lt;h3&gt;Посилання&lt;/h3&gt;&lt;ul class=&quot;ui-box file-list&quot;&gt;&lt;li&gt;&lt;a href=&quot;https://www.youtube.com/watch?v=ika2opv3XEw&amp;amp;feature=emb_logo&quot; target=&quot;_blank&quot;&gt; Керівництво по експлуатації &lt;/a&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(34, 34, 34); font-size: 14px;&quot;&gt;&lt;/p&gt;",
